import React, { useState } from 'react';
import Modal from 'react-modal';
import { useGetAbout } from './_query'
import Layout from '../components/layout'

import styles from './about.module.css'

export const About = () => {
  const { data, isLoading } = useGetAbout()
  const [employeePictures, setEmployeePictures] = useState([
    { picture: data?.personeel1.sourceUrl, altText: data?.personeel1.altText },
    { picture: data?.personeel2.sourceUrl, altText: data?.personeel2.altText },
    { picture: data?.personeel3.sourceUrl, altText: data?.personeel3.altText }
  ])

  const [atmospherePictures, setAtmospherePictures] = useState([
    { picture: data?.sfeer1.sourceUrl, altText: data?.sfeer1.altText },
    { picture: data?.sfeer2.sourceUrl, altText: data?.sfeer2.altText },
    { picture: data?.sfeer3.sourceUrl, altText: data?.sfeer3.altText },
    { picture: data?.sfeer4.sourceUrl, altText: data?.sfeer4.altText }
  ])
  const [visiblePicture, setVisiblePicture] = useState([])
  const [modalIsOpen, setIsOpen] = React.useState(false)
  const [modalIsOpen2, setIsOpen2] = React.useState(false)
  const [modalIsOpen3, setIsOpen3] = React.useState(false)
  const [modalIsOpen4, setIsOpen4] = React.useState(false)
  const [modalIsOpen5, setIsOpen5] = React.useState(false)
  const [modalIsOpen6, setIsOpen6] = React.useState(false)
  const [modalIsOpen7, setIsOpen7] = React.useState(false)
  const [modalIsOpen8, setIsOpen8] = React.useState(false)


  const personeel1 = data?.personeel1.sourceUrl
  const personeel2 = data?.personeel2.sourceUrl
  const personeel3 = data?.personeel3.sourceUrl
  const personeel4 = data?.personeel4.sourceUrl

  const sfeer1 = data?.sfeer1.sourceUrl
  const sfeer2 = data?.sfeer2.sourceUrl
  const sfeer3 = data?.sfeer3.sourceUrl
  const sfeer4 = data?.sfeer4.sourceUrl

  const customStyles = {
    content: {
      top: '57%',
      left: '50%',
      right: 'auto',
      bottom: 'auto',
      marginRight: '-50%',
      transform: 'translate(-50%, -50%)',
      backgroundColor: "rgb(233, 229, 229)",



    },
  };

  return (
    <Layout>
      <div className={styles.container}>
        <h2 className={styles.title}>{data?.goalTitle}</h2>
        <div className={styles.goalContainer}>
          <div key={data?.goalDescription} className={styles.goalDescription}>{data?.goalDescription}</div>
          <div className={styles.groupGoalPic}>
            {employeePictures && employeePictures?.map((item) =>
              <div key={item.altText} onClick={() => { setIsOpen(true); setVisiblePicture((prev) => ({ ...prev, picture: item.picture, altText: item.altText })) }} style={{ cursor: "pointer" }} className={styles.clickableImages}> <img key={item.altText} src={item.picture} alt={item.altText} className={styles.goalImage} /></div>
            )}
          </div>
        </div>

        <h2 className={styles.missionTitle}>{data?.missionTitle}</h2>
        <div className={styles.missionContainer}>
          <div className={styles.groupMissionPic}>
          <div className={styles.missionDescription}>{data?.missionDescription}</div>
            {atmospherePictures && atmospherePictures?.map((item) =>
              <div key={item.altText} onClick={() => { setIsOpen(true); setVisiblePicture((prev) => ({ ...prev, picture: item.picture, altText: item.altText })) }} style={{ cursor: "pointer" }} className={styles.toughableImage}> <img key={item.altText} src={item.picture} alt={item.altText} className={styles.goalImage} /></div>
            )}

          </div>

        </div>
        <Modal
          isOpen={modalIsOpen}
          style={customStyles}
          onClose={modalIsOpen}
          onRequestClose={modalIsOpen}
        >
          <div className={styles.modalImageContainer}>
            <img src={visiblePicture?.picture} alt={visiblePicture?.altText} className={styles.miniImage} />
            <button onClick={() => setIsOpen(false)} className={styles.modalBtn}>Close</button>
          </div>
        </Modal>

      </div>
    </Layout>
  );
}
